import React from "react";

const Panel = ({ w, convex = false, concave = false, children }) => {
  return (
    <div className={`pnl-ctn pnl-ctn-${w}`}>
      <div className={`pnl ${convex ? "convex" : concave ? "concave" : ""}`}>
        {children}
      </div>
    </div>
  );
};

export default Panel;
